Description:
            Handmade crocheted pet bed will be perfect accent for your living room and comfortable bed for your beloved cat or small puppy. 
Basket is made of durable long-lasting, sustainable rope, it is crocheted tightly, so this bed will serve you for a long time and will keep form well. It will stay beautiful home accent for a long time.
Bed is crocheted of dark grey color polyester rope. Other colors are also available for these beds, please take a look at the rope color palette ( the last picture).
